    console.log(data);
  };
  return (
    <React.Fragment>
      <Card style={{ width: "50%", left: "25%" }}>
        <Card.Body>
          <Header name="Add Task" />
          <ExpenseForm onAddTask={addTaskHandler} />
        </Card.Body>
      </Card>
      <Card style={{ width: "50%", left: "25%" }}>
        <Card.Body>
          <Expenses />
        </Card.Body>
      </Card>
    </React.Fragment>
  );
};

export default App;
